INSERT [dbo].[ref_programs] ([obsprg_code], [description], [comments], [entered_by], [entered_dtime]) VALUES (N'AROB', N'ARTP Observer data', N'These data represent the SPC observers operating on Troll vessels in NZ waters and the STCZ during the late 1980s and early 1990s. Tagging, Length Frequency and bycatch data were collected but have not been entered into the observer database system. The Tagging data exists as a separate system aligned to the regional Tagging databases. The Length Frequency data are a part of the SPAR LF data (and are included in the OFP common LF database). The Bycatch data exist in hard-copy format with the rest of the hard-copy ARTP data in the store room below Health Section. It has not yet been entered.', N'dbadmin', CAST(0x9B6E0202 AS SmallDateTime))
INSERT [dbo].[ref_programs] ([obsprg_code], [description], [comments], [entered_by], [entered_dtime]) VALUES (N'ASOB', N'American Samoa Observer Programme', N'', N'dbadmin', CAST(0x9B6E0202 AS SmallDateTime))
INSERT [dbo].[ref_programs] ([obsprg_code], [description], [comments], [entered_by], [entered_dtime]) VALUES (N'AUOB', N'Australia Observer Programme', N'Observer data provided by the Australian Fisheries Management Authority (AFMA) (July 1998, 2000 and in April 2002). These data are confidential and should not be used outside of the OFP without prior consultation of the Principal Fisheries Scientist (Statistics) and AFMA.

As the AFMA data structures do not match the SPC observer database standard, considerable work was required in converting the data to our database formats. In doing so, there were several areas worth noting:

*	The FATE code provided was basic and not as comprehensive as that currently used by SPC. The fate code for sharks was assigned based on the following information provided by Bob Stanley (AFMA). 

	"... "C" means cut free without landing. The life status from my experience could mean anything from alive and vigorous to dead in rigour but almost without exception there would be no fins taken. "N" prior to 95 would most certainly mean that the shark was landed and finned then the beast dispatched over the side. After 95 this would be common practice where there was no observer on board the vessel. After 95 where an observer record exists this would mean the shark was disposed of as whole but there will most normally be a life status noted. "R" again using the 95 as the turning point I feel there would be very little of the "R" noted pre 95 if it was it would refer to fins only. After 95 it would mean the fins and a minimalist trunk was retained. We have plenty of anecdotal evidence that the trunk would be ditched over the side when the observer left the vessel. The shark code of practice was taken more seriously by the Japanese in 95 but more so in 96 and 97. We have not had a Japanese presence in 98 and 99 seasons."

*	Prior to 1991 there was no effort or gear characteristics reported (catch only)

*	The period 1981-1986 reported the catch of SBF only, so the BYCATCH flag has been set to .F. to indicate that bycatch monitoring was not done.

*	The following information is provided in more detailed format than currently supported by the Regional database :

	- Branchline length ... available for each snood
	- Floatline length ... 

*     Where the fate (processing) was not mentioned and unless clearly discarded, BET, YFT and SBF were set to "RGG". ALB were set to "RWW".
 
The above notes should form the basis of data requests in the future.

------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------	

Australian Observer data was provided by AFMA on 13th July 2005 covering the Australian domestic longline fleet operating off the east coast of Australia, covering the years 2001-2005. These data are confidential and should not be used outside of the OFP without prior consultation of the Principal Fisheries Scientist (Statistics) and AFMA.

The original data contained detailed information on the following attributes collected by observers : gear, performance, vessel and setting parameters. However, these data collection items are not standard with the SPC/FFA data collection forms (which is the basis of the regional observer data), so some of these data have not bee added. Users are referred to the original AFMA databases for complete information. 

(As at October 20th 2005,  we have requested more informatoin on the reference codes used).

These data were not loaded.

------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------	

Australian Observer data was provided by AFMA on 7th November 2006 covering the Australian domestic longline fleet operating off the east coast of Australia, covering the years 1999, 2001-2006. These data are confidential and should not be used outside of the OFP without prior consultation of the Principal Fisheries Scientist (Statistics) and AFMA.

Certain data (e.g. gear, vessel and setting parameters) are not included or differ with the SPC/FFA data collection forms (which is the basis of the regional observer data), so have not been added. Users are referred to the original AFMA databases for complete information. 

Note that the basic details of interractions of "species of special interest" have been stored in the observer catch monitoring database table. The detailed information on interractions/observerations of "wildlife" has been collected on a different (AFMA) form than the SPC/FFA data collection forms, so has not been included in the Regional version of the "Species of Special Interest"  database. Users are referred to the original AFMA databases for complete information. 

It is understood that observer trips conducted in Australia sometimes have specific purposes, and this may, in some instances, introduce bias depending on the type of analysis using the data (for example, bird mitigation projects may bias analyses looking at bird interraction). 

To provide an indication of project purpose, each observer trip has been identified with a PROJECT ID as follows :

	ECTBF			- Generic East Coast Tuna Longline - 5.1% over 5 years
	LLCHUTE		- Long Line Chute
	LLTORI60		- Double tori lines with 60 gram swivels 5m from hook
	LLTORIPL		- Long Line Tori Pole

In general, Users need to be aware of and understand where specific projects might impose variations on fishing operations that may then impact the catch (or catch composition) of those operations.

Also, it is often useful to consider the species targeting field in conjunction with PROJECT ID. For example, there was at one point a disproportionately large focus by observers toward SBT targeting longliners, with that small subset of vessels operating quite differently to the rest of the fleet.

The data were loaded and available on 28th November 2006.
', N'dbadmin', CAST(0x9B6E0202 AS SmallDateTime))
