INSERT [dbo].[ref_programs] ([obsprg_code], [description], [comments], [entered_by], [entered_dtime]) VALUES (N'HWOB', N'Hawaii-NMFS Observer Programme', N'Observer data provided by the National Marine Fisheries Service (NMFS) (December 2001) for the Hawaiian domestic longline fishery. These data are confidential and should not be used outside of the OFP without prior consultation of the Principal Fisheries Scientist (Statistics), the Fisheries Database Supervisor and NMFS.

As the NMFS data structures do not match the SPC observer database standard, considerable work was required in converting the data to our database formats. In doing so, there were several areas worth noting:

*	Observer names and vessel names have not been provided with these data. (Confidentiality).

*	The time that individual catch was taken has not been provided, but the float number (i.e. ''basket") that catch was taken has been provided. Time of catch has therefore been calculated using the float/hook number of the catch relative to the duration of the haul and the total number of floats/hooks observed. Bycatch that is typically discarded does not have the float/hook number and therefore the time of catch has been set to the start time of the haul.

*	Fate codes are restricted to "retained" and "discarded" only. In some instances, the finning of sharks are described and are therefore used. Where the fate (processing) was not mentioned, and unless clearly discarded, BET and YFT were set to "RGG". ALB were set to "RWW".

*	Lengths of fish were restricted to Tunas, billfish shark and protected species only. No bycatch was measured.

*	Approximate lengths (in feet) have been provided for some species, but as these are only approximate (i.e. observer estimates) , they have not been used.

*	Bait species have been coded, but no reference table provided (awaiting response from NMFS before possibly using these data).

*	The billfish measurements of Eye to caudal fork and Cleithrum to caudal fork are inconsistent. (Awaiting further information from NMFS see trip LL0363). 

*	Target species for each set is available and has been stored. (Resulting in a new field in the Regional observer database).
 
The above notes should form the basis of data requests in the future.

-----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
An update was provided on 14 March 2005, covering the period 2001-2004. The notes above apply.  

Please note that the data collection forms used in the Hawaii Longline Observer programme aare different to the SPC/FFA Regional standards and therefore some information are not collected and additional information are collected (compared to the SPC/FFA Regional data collection forms). Users of the data are referred to the following web site for details on the structure of the database tables and reference codes.	

-----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------

', N'dbadmin', CAST(0x9B6E0202 AS SmallDateTime))
