INSERT [dbo].[ref_programs] ([obsprg_code], [description], [comments], [entered_by], [entered_dtime]) VALUES (N'NZOB', N'New Zealand Observer Programme', N'Observer data provided by the Ministry of Fisheries (New Zealand) (September 2000). The following conditions apply  as a consequence of MAF data confidentiality policies 

*	Vessel names, call sign and registration numbers have not been provided. The only attribute of the vessel is the gear (i.e. all are longline) and vessel nation (either JP or NZ).
*	Positions are to the nearest degree. That is, the minutes have been truncated from the positional information.

As the MAF data structures do not match the SPC observer database standard, considerable work was required in converting the data to our database formats. In doing so, there were several areas worth noting:

*	The codes for procesing and handling for sharks did not clearly indicate (in some instances) whether the shark was finned when the whole shark was retained. I have assumed that finning occured when converting to the SPC format (i.e. finned and shark retained).
*	Each branch line length is recorded in the MAF system. Their system allows the reporting of different length of branchlines in the same basket. I have taken the branchline with the maximum length in the conversion to the SPC format.
*	Baiting strategies for each hook in the basket can be recorded in the MAF system (in addition to colour of hook, etc.). I have only taken the first four unique baits in the conversion to the SPC format.
*	MAF use a logical variable (indicator) of data quality. Data deemed to have problems have been rejected outright during the transfer.
*	There were many records in early years for which FATE and MEASURE codes were not provided. These have been set accordingly (i.e. to ''U - unknown'')
*	There are considerable conversion factor data. I have added the new fields to our database  to cater for (i) Eye orbital to fork length , (ii) standard length (i.e. tip of snout to posterior base of caudal peduncle) and (iii) sex id (sex should be added to our conversion factor form !!).

The system documentation for the MAF tuna longline observer database is described in the NIWA internal repot No. 244 - 14. l_line (tuna longline) -- K. Mackay and S. Kalish. 

------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------	

An update of the New Zealand Observer data was provided by MAF on 13th May 2005 covering the New Zealand domestic longline fleet for the years 2001-2004. These data are confidential and should not be used outside of the OFP without prior consultation of the Principal Fisheries Scientist (Statistics) and MAF.

The original data contained detailed information on some attributes collected by observers. However, these data collection items are not standard with the SPC/FFA data collection forms (which is the basis of the regional observer data), so some of these data have not bee added. Users are referred to the original MAF databases for complete information. 

(Awaiting more information on bait codes - as at 20th October 2005).


', N'dbadmin', CAST(0x9B6E0202 AS SmallDateTime))
